import'./webpage.css'

function Message() {
  return (
    <div>

      <div id='navi'>
<Navbar bg="rgb(68, 92, 21);" expand="lg">
      <Container>
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <div>
        <i id='hello' class="fa fa-cog" aria-hidden="true"></i>
        <i id='helllo' class="fa fa-shopping-cart" aria-hidden="true"></i>
        <a href='#'>crds</a>
        </div>
      </Container>
    </Navbar>
    </div>
    </div>
  );
}

